HI there! I would like to personally invite you to check out Modeka's latest shows. Solenn Heussaff embarks on her third solo exhibit entitled *"Kundiman"* where she shows 11 canvas works wherein each piece is a product of months of labor-intensive work based on photographs she has taken while out of the streets and culminates after years of creating and accumulating pieces. ⁠⁠

Visual artists Liliana Manahan's solo exhibit entitled *"Unlimited"* features functional sculptural & jewerly pieces along with some amazing paper works.

*Equilibrium" features works by some of the country's talented abstract artists namely Alfonso Recto, Fitz Herrera, Ian Inoy, Jun-Jun Sta. Ana, and Sam Penaso.

All shows will be open for private views starting March 30 and will run til April 24.  Message @modeka.art to book your slot.  Alternatively, you  may also view the shows online on experiences.modeka.space .

Big thank you to @love.teresaherrera of @collective88 for curating my show :)

